  \"2016-05-31T01:07:00.436583\",\n\t\"name\": \"afsc-race-mace-results-of-2008-pollock-acoustic-trawl-survey-shelikof-dy0803\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Scientists from the Midwater Assessment
  and Conservation Engineering (MACE) Program of the Alaska Fisheries Science Center's
  (AFSC) Resource Assessment and Conservation Engineering (RACE) Division routinely
  conduct echo integration-trawl (EIT) stock assessment surveys in the Gulf of Alaska
  (GOA) during late winter and early spring to estimate the distribution and abundance
  of walleye pollock (Theragra chalcogramma). Most of these efforts have been focused
  on the Shelikof Strait area, which has been surveyed annually since 1980, except
  in 1982 and 1999. Surveys were also conducted in the Shumagin Islands area in 1994-96,
  2001-03, and 2005-07 and along the GOA continental shelf break east of Chirikof
  Island to Barnabas Trench in 2002-07. This report presents the distribution and
  abundance of walleye pollock for surveys conducted in the GOA during February and
  March 2008.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"temporal-extent-begin\",\n\t\t\"value\":
